import React from 'react';

const WorkoutDetails = ({ workout }) => {
	return (
		<div className='workout-details'>
			<h4>{workout.title}</h4>
			<p>
				<strong>Weight: </strong>
				{workout.weight}
			</p>
			<p>
				<strong>Sets: </strong>
				{workout.sets}
			</p>
			<p>
				<strong>Reps: </strong>
				{workout.reps}
			</p>
			<p>
				<strong>Date: </strong>
				{workout.createdAt}
			</p>
		</div>
	);
};

export default WorkoutDetails;
